import React, { useState } from 'react';
import {Input, Form} from 'antd';

export default function TextInput({item}){

    return(
        <Form.item 
        label={item.questao} 
        name={item.numero}
        rules={item.regra} 
        >
            <Input.TextArea />
        </Form.item>
    );
}
